function OVR()
	--print("Quest: "..tostring(onQuest),0,16)
	HUD()
	Quest()
end

function HUD()
	--Draws the HUD
	if not title then
		rect(rl,0,rw,15,4)
		line(rl-1,0,rl-1,15,1)
		line(40,15,199,15,1)
		line(200,0,200,15,1)
		
		if onQuest then
			spr(16,rl+5,4,5)	
			print("Stability:",rl+15,6,1,true,1,true)
			--Create the status bar
			rect(94,5,stab,7,2)
			rectb(94,5,100,7,1) -- status bar border
		end
		rect(0,123,38,135,4)
		rectb(0,123,38,135,1)
		spr(9,3,126,5)
		print("x "..p.stabpot,13,128,1,false,1,false)
	else
		rect(72,113,91,7,4)
		rectb(71,112,93,9,1)
		print("Press A to Start",73,114)
	end
end

function TIC()
	--[[this breaks the game and doesn't allow the door
	to open--
	if not title then
		sync(0,0,false)
	end]]
	cls(4)
	if inDungeon then
		map((p.x//240)*30,(p.y//136)*17,30,17,0,0,5,1,AnimTiles)
	else
		map((p.x//240)*30,(p.y//136)*17,30,17,0,0,5,1)
	end
	--natural order of things
	if p.canMove then
		Controls()
	end
	
	Update()
	Draw()
	Use()
	t=t+1
	--print(stab)
	if title then
		Title()
	end
end

function Title()
	sync(0,2,false)
	map(0,0)
	
	if btnp(c.a) then
		title=false
		sync(0,0,false)
	end
end

function Controls()
	if btn(c.d) then 
		c_down(p) 
	end
	if btn(c.z) then 
		c_jump(p) 
	end
	if btn(c.l) then 
		c_left(p)
	end
	if btn(c.r) then 
		c_right(p) 
	end
	if btnp(c.a) then
		Use()
	end
end

function Draw()
	
	--draw the particles
	for i,d in pairs(dust) do
		if onscreen(d) then
			circ(d.x%240,d.y%136,d.r,d.c)
		end
	end
	
	--draw the player
	if not p.dead then
		spr(p.idx+p.frm,p.x%240,p.y%136,5,1,p.flp,0,2,2)
	end
end

function Use()
	if fget(mget(p.x/8,p.y/8),1) and btnp(c.a) and quest.one then
		msgbox.q1=true
		sfx(18,D8,4)
	end
	if fget(mget(p.x/8,p.y/8),2) then
		CompleteQuest()
	end
	if fget(mget(p.x/8,p.y/8),1) and btnp(c.a) and quest.two then
		msgbox.q2=true
		sfx(18,D8,4)
	end
	if fget(mget(p.x/8,p.y/8),3) then
		CompleteQuest2()
	end
	if fget(mget(p.x/8,p.y/8),1) and btnp(c.a) and quest.three then
		msgbox.q3=true
		sfx(18,D8,4)
	end
	if fget(mget(p.x/8,p.y/8),4) then
		CompleteQuest3()
	end
end
----- UPDATES ------------------------

function Update()
	UpdatePlayer()	
	Particles()
	ShakeScreen()
	Spikes()
	Stabilizer()
	Drain()
end

function UpdatePlayer()
	--applies physics to the player
	py(p,frict,1,grav)

	--applies collision to the player
	if collide(p,15,15) then
		new_dust(p.x+4,p.y+15,2.5)
		sfx(0)
		--stability percentage
		if onQuest then
			prc=stab*0.05
			stab=flr(stab-prc)
		end
	end

	--moves the player
		move(p)
	--checks if the player is falling or going up
	checkanim(p)
	--animates the player
	p.anim(p)
	
	--reset all variables
	p.x,p.y=p.x%(240*8),p.y%(136*8)
	p.down=false
	p.anim=a_idle
	
	if stab<=0 then
		p.dead=true
		KillPlayer() 
	end
end

function Drain()
	if inDungeon and onQuest then
		stab=stab-.01
	end
	--prc=stab*0.25
	--stab=flr(stab-prc)
end

function Spikes()
	if fget(mget(p.x//8,p.y//8),7) and p.takeDmg then
		prc=stab*0.25
		stab=flr(stab-prc)
		p.takeDmg=false
		screenShake.active=true
		sfx(19,20,20,2,15)
	end
end

function KillPlayer()
	if p.dead then
		p.canMove=false
		spr(288+t%30//10,p.x,p.y,5,1,0,0,2,2)
		spr(294,p.x,p.y,5,1,0,0,2,2)
		AddWin(hw,hh,90,38,qtxt.dead)
		rect(159,81+math.sin(time()//90),7,7,4)
		print("S",160,82+math.sin(time()//90),1)
		
		if btnp(c.s) then
			reset()
		end
	end
end

