		onQuest=true
		msgbox.q3=false
		mset(4,10,130)
		mset(13,8,136)
		mset(13,9,152)
		mset(13,10,168)
		mset(13,11,184)
	end
end

function CompleteQuest()
	if onQuest then
		p.canMove=false
		AddWin(hw,hh,90,38,qtxt.fin)
		rect(159,81+math.sin(time()//90),7,7,4)
		print("S",160,82+math.sin(time()//90),1)
	end
	
	if btn(c.s) then
		Lvl2()
		onQuest=false
		p.canMove=true
	end
end

function CompleteQuest2()
	if onQuest then
		p.canMove=false
		AddWin(hw,hh,90,38,qtxt.fin2)
		rect(159,81+math.sin(time()//90),7,7,4)
		print("S",160,82+math.sin(time()//90),1)
		p.stabpot=0
	end
	
	if btn(c.s) then
		Lvl3()
		onQuest=false
		p.canMove=true
	end
end

function CompleteQuest3()
	if onQuest then
		p.canMove=false
		AddWin(hw,hh,90,38,qtxt.fin3)
		rect(159,81+math.sin(time()//90),7,7,4)
		print("S",160,82+math.sin(time()//90),1)
		p.stabpot=0
		inDungeon=false
	end
	
	if btn(c.s) then
		--GameComplete()
		onQuest=false
		reset()
	end
end

function Lvl2()
	p.canMove=true
	p.x=72
	p.y=216
	quest.two=true
end

function Lvl3()
	sync(0,1,false)
	inDungeon=true
	p.canMove=true
	p.x=80
	p.y=80
	quest.three=true
end

function Stabilizer()
	if btnp(c.x) and p.stabpot>0 and stab>=70 and stab<=100 then
		stab=100
		p.stabpot=p.stabpot-1
		sfx(16)
	elseif btnp(c.x) and stab<70 and p.stabpot>0 then
		stab=stab+30
		p.stabpot=p.stabpot-1
		sfx(16)
	end
end

function GameComplete()
	map(0,51)
	spr(416,0,408,5,1,0,0,16,6)
end

function GameOver()
	
	map(0,51)
end
--updates the particles
function Particles()
	for i,d in pairs(dust) do
	 --applies physics and movement
		py(d,.95,.95,0)
		move(d)	
		
		--changes its color overtime
		if d.t<5 then 
			d.c=1 --dust colors
		else
			d.c=2 --dust colors
		end
		
		--when the timer ends, gets tiny and then deleted
	 d.t=d.t-1+rnd()
		if d.t<1 then 
			d.r=d.r/1.1
		end
		if d.r<1 then	
			del(dust,i) 
		end
	end
end

