--applies an objects velocity to its position
function move(o)
	o.x=o.x+o.vx
	o.y=o.y+o.vy
end
		
--applies friction and gravity on an object
function py(o,frict_x,frict_y,grav)
	o.vx=o.vx*frict_x
	o.vy=o.vy*frict_y
	o.vy=o.vy+grav 
	o.vy=min(max(o.vy,-3),3)
end

--checks if something is on the same map area of the player
function onscreen(o)
	return p.x//240==o.x//240 and p.y//136==o.y//136
end

--checks if an object is in the air to apply the right animation
function checkanim(o)
	if not p.dead then
		if o.vy>0 then 
			o.anim=a_fall
		elseif o.vy<0 then 
			o.anim=a_jump 
		end
	end
end

--plays a sfx if the object has the "player" tag
function psfx(o,i)
	if o.type=="player" then
		sfx(i) 
	end 
end

--creates 10 new dust particles and put the in the dust list
function new_dust(x_,y_,r_)
	for i=0,10 do
		table.insert(dust,
		{
			x=x_,
			y=y_,
			vx= cos(rnd(30))/2,
			vy= -sin(rad(rnd(180)))*(rnd()*2)/5,
		 r=rnd()*r_,
			t=r_*5
		})
	end
end

--stop an object of passing through blocks
--and returns true if it just hit the ground
function collide(o,w,h)
	local r=false
 local x,vx,y,vy=o.x,o.vx,o.y,o.vy
	
	if fget(mget((x+vx)  //8,(y)  //8),0) or 
			 fget(mget((x+vx)  //8,(y+h)//8),0)	or
				fget(mget((x+vx+w)//8,(y)  //8),0) or 
				fget(mget((x+vx+w)//8,(y+h)//8),0)then
				o.vx=0 end
	
	local vx=o.vx
	
 if fget(mget((x+vx)  //8,(y+vy)  //8),0) or
   	fget(mget((x+vx+w)//8,(y+vy)  //8),0) or
				fget(mget((x+vx)  //8,(y+vy+h)//8),0) or
	   fget(mget((x+vx+w)//8,(y+vy+h)//8),0)then
			if o.vy > .6 then
					r=true
			end 
			o.vy=0
	end
	
	--checks if the object is on the ground
	if fget(mget(x//8,(y+h+1)//8),0) or fget(mget((x+w)//8,(y+h+1)//8),0) then
		o.grnd = true else
		o.grnd = false
	end
	
	--checks if the object is below something
	if fget(mget(x//8,(y-1)//8),0) or fget(mget((x+w)//8,(y-1)//8),0) then
		o.ceil = false else
		o.ceil = true
	end
	
	return r
end
	
----- CONTROLS -----------------------

--if an object can jump, jump
function c_jump(o)
	if o.grnd and o.ceil then
		o.vy=o.mvup psfx(o,1)
		p.takeDmg=true
		--stability percentage
		if onQuest then
			prc=stab*0.01
			stab=flr(stab-prc)
		end
		if mget(p.x//8,p.y//8)==241 or mget(p.x//8,p.y//8)==209 or mget(p.x//8,p.y//8)==225 then
			p.inWater=true
		end
		if p.inWater==true then
			o.mvup=-6
			o.vy=o.mvup
		else
			o.mvup=-2.5
			o.vy=o.mvup
		end
		p.inWater=false
	end
end

--crounching
function c_down(o)
	o.anim=a_down
	o.down=true
end

--goes left
function c_left(o)
	o.vx=o.vx-o.mv 
	o.flp=0
	o.anim=a_walk
end

--goes right
function c_right(o)
	o.vx=o.vx+o.mv
	o.flp=1
	o.anim=a_walk 
end

----- ANIMATIONS ---------------------

function a_idle(o)
	if t%20==0 then
		o.frm=o.frm+2 
	end
		
	if o.frm>3 then 
		o.frm=0 
	end
end		
		
function a_walk(o)
	if t%16==0 then
		psfx(o,2)
	end

	if t%12==0 then
		o.frm=o.frm+2
	end
			
	if o.frm<4 or o.frm>7 then 
		o.frm=4 
	end
end

function a_down(o)
	o.frm=14
end
	
function a_jump(o)
	o.frm=10
end
	
function a_fall(o)
	o.frm=12
end

function AnimTiles(animTile)
	local outTile,flip,rotate=animTile,0,0
	local at=tileAnims[animTile]
	if at then
		outTile=outTile+flr(t*at.s)%at.f
	end
	return outTile,flip,rotate
end

function ShakeScreen()
 if screenShake.active==true then
		poke(0x3FF9,math.random(-screenShake.power,screenShake.power))
		poke(0x3FF9+1,math.random(-screenShake.power,screenShake.power))
		screenShake.duration=screenShake.duration-1
		
		if screenShake.duration<=0 then
			screenShake.active=false
		end

 else
  memset(0x3FF9,0,2)
  screenShake.active=false
  screenShake.duration=screenShake.defaultDuration
	end
end
